import React, { useEffect, useState } from "react";

const App = () => {
  const apiKey = "AIzaSyD_0oGw93lCcNaUkmdnEU780lDHOOnb-jI";
  const channelId = "UCVJT18d9wSCnDUdnJ9ycO7Q";
  const [loading, setLoading] = useState(true);
  const [playlist, setPlaylist] = useState([]);

  const getPlaylist = async () => {
    const json = await (
      await fetch(
        `https://www.googleapis.com/youtube/v3/playlists?key=${apiKey}&channelId=${channelId}&maxResults=50&part=contentDetails`
      )
    ).json();
    setPlaylist(json);
    console.log(playlist)
    setLoading(false);
  };

  useEffect(() => {
    getPlaylist();
  },[]);

  return (
    <div>
      {loading ? (
        <h1>loading...</h1>
      ) : (
        <div>
          {playlist.items.map((list) => {
            <div>
              <h1>{list.kind}</h1>
              <ul>
                <li></li>
              </ul>
            </div>
          })}
        </div>
      )}
    </div>
  );
};
export default App;
